(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'ANTH', 'Anthropology', '11A', '11', 'A', 74043, 'Cultures and Ideas I', 'MWF', 9, '09:15 AM', '10:20 AM', 'OCONR 209', '', '', '', '', 'Kroot,Matthew V.', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 2, 'Peace & Violence', 'Peace & Violence will offer a two-course sequence that explores the critical role that these dimensions of conflict resolution have played in human societies.   Central to the courses is understanding how elements of peace and violence are interwoven in complex ways through all cultures.  The historical dimension is critical for both classes since we must underline how patterns of peace and violence vary over time and how events of the past are culturally immersed in peace and violence patterns of the present. The course will emphasize broad global interconnections.  Offered Fall 2018 and Winter 2019.', '', '', ''),
