(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'ARTH', 'Art History', '11A', '11', 'A', 74281, 'Cultures and Ideas I', 'MWF', 10, '10:30 AM', '11:35 AM', 'DOWD 208', '', '', '', '', 'Clydesdale,Heather D', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 1, 'China on the Silk Roads', 'China on the Silk Roads: The network of ancient routes, known today as the Silk Roads, connected China to Central and South Asia, the Mediterranean and beyond. As conquerors, traders, monks, brides, and adventurers travelled, they exchanged raw materials and finished goods, translated texts, and introduced belief systems. Today, archaeological excavations and ancient artifacts continue to play a dynamic role as China engages in the "Great Game" of global geopolitics.  Offered Fall 2018 and Winter 2019.', '', '', ''),
(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'ARTH', 'Art History', '11A', '11', 'A', 74282, 'Cultures and Ideas I', 'MWF', 10, '10:30 AM', '11:35 AM', 'DOWD 210', '', '', '', '', 'Maxwell,Kathleen E', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 1, 'Art, Power, & Propaganda', 'Art, Power, & Propaganda: This two-quarter course addresses two artistic styles usually considered antithetical: classical art of ancient Greece developed in the 5th century B.C.E. and Islamic art which first appears over 1000 years later in the 7th C.E. Classical art and culture serve as the foundation of what is known as the Western canon and Islamic art is often juxtaposed to it as one of a number of ""non-Western"" (i.e., Oriental) forms of artistic expression. Our first goal is to appreciate their differences and to recognize significant areas of cross-fertilization. We shall discover that classical culture played as important a role in the formation of Islamic culture as it did in Western culture. We will ask what did the classical style symbolize to those who resurrected it in so many neoclassical episodes throughout history? How often can neoclassicism be linked to political goals?  Offered Fall 2018 and Winter 2019.', '', '', ''),
