(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'ARTH', 'Art History', '11A', '11', 'A', 74279, 'Cultures and Ideas I', 'MWF', 9, '09:15 AM', '10:20 AM', 'DOWD 210', '', '', '', '', 'Vivrette,Leticia Rios Rodriguez', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 1, 'East of Greece, West of Persia', 'East of Greece, West of Persia: The Greco-Persian dynamic, often imagined as the fundamental struggle between a \Zcivilized\Z\Zand therefore culturally superior\Zdemocratic Greece, and the \Zbarbaric\Z super-power that was Achaemenid Persia, still resonates today in the relationship between Europe and the Middle East. We will explore the history and legacy of contact between Greek and Persian cultures through an examination of archaeology, visual sources and text. With the help of a number of primary and secondary historical and theoretical readings, we will analyze architecture, sculpture and \Zminor\Z arts that both reflect, and reflect on, this cultural exchange. The course\Zs primary focus will span from the sixth century BCE and the rise of Cyrus the Great, through the war between Alexander the Great and Darius III in the fourth century BCE. In analyzing these materials, we will also examine how interactions between these two great powers represent a larger ideological clash between East and West. We will closely examine the archaeological and material evidence of the critical geographic point of contact of Western Anatolia itself, along with its various cultural groups, especially Lydians and Phrygians. In noting the interchange between these groups and their Greek and Persian neighbors, we will consider how and why history has overlooked these actors in this binary, oppositional narrative.\nOffered Fall 2018 and Winter 2019.', '', '', ''),
