(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'ENGL', 'English', '11A', '11', 'A', 74370, 'Cultures and Ideas I', 'MW', 15, '03:30 PM', '05:15 PM', 'OCONR 205', '', '', '', '', 'Garavel SJ,Andrew James', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 1, 'Gods & Mortals', 'Gods & Mortals critically examines, in a two-course sequence, how a culture\'s ideas about the gods (or God, divinity, or unseen world) reveal that culture\'s view of the human person and society within the larger world. That is, how a culture (or individuals within a culture) imagines the deity corresponds directly to what it regards as most significant about human life, its limitations and possibilities, its tragedies and triumphs, its sense of justice and injustice.  Throughout the sequence, students will be urged to analyze this correspondence against a range of texts, events, and artistic forms by asking such questions as: What kind of a god does this text reveal? What is the nature of the deity\Zs relationship with mortals?  Is there an ethical component to the relationship?  How do gods and mortals compare?  Are there ways in which the latter are more honorable?  How does an author\'s or artist\'s conception of the distinction between gods and mortals shed light on his or her understanding of human life?  Of meaning in the face of death and other limitations?  Offered Fall 2018 and Winter 2019', '', '', ''),
