(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'ENGL', 'English', '106', '106', '', 74427, 'Advanced Writing', 'MWF', 14, '02:15 PM', '03:20 PM', 'OCONR 207', '', '', '', '', 'Donegan,Melissa M', '', '', 0, '5.00', '5.00', 'N', 0, 'E', 1, 'Writing Well(ness)', 'This course takes as its theme the relationships between illness, wellness, and writing and explores topics like cancer, PTSD, death, mourning, and renewal. We will examine personal, social, cultural, and historical responses to illness, loss, and recovery and the role of narrative in those responses. Texts will include stories, essays, films, plays, and poetry.', 'UC24', 'Third Writing', ''),
