(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'ENGL', 'English', '190', '190', '', 74419, 'Senior Seminar', 'TR', 15, '03:50 PM', '05:30 PM', 'OCONR 204', '', '', '', '', 'Hansen,Ronald Thomas', '', '', 0, '5.00', '5.00', 'D', 0, 'E', 1, 'Some Films by Martin Scorsese', 'Class is 2 days/week on Tuesdays & Thursdays. We\'ll be viewing 10 representative films from Scorsese\'s impressive catalog, including Mean Streets, Taxi Driver, Raging Bull, Goodfellas, The Age of Innocence, and The Wolf of Wall Street.  We\'ll view and discuss a film each Tuesday and hear seminar reports by the seniors on Thursdays.', '', '', 'Course restricted to Senior English majors'),
(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'ENGL', 'English', '11A', '11', 'A', 74421, 'Cultures and Ideas I', 'MWF', 8, '08:00 AM', '09:05 AM', 'CASA 3', '', '', '', '', 'Hawley,John C', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 1, 'Cross Cultural Contact', 'Cross-cultural contact. In this two-course sequence, we will study and analyze representations of cross-cultural contact in the various contexts of travel, captivity, conquest, migration, and occupation. The thematic material for the first half of the sequence is the historic and ongoing encounter between Christians and Muslims, from the middle ages and Crusades to post-9/11.  In the second course we focus on Africa and its global engagements\Zincluding the slave trade, colonization, commerce, art, etc.\nOffered Fall 2018 and Winter 2019', '', '', ''),
(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'ENGL', 'English', '181', '181', '', 74422, 'Engineering Communications', 'MWF', 9, '09:15 AM', '10:20 AM', 'OCONR 109', '', '', '', '', 'Riccomini,Donald R', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 1, '', '', '', '', 'UENGR major ONLY and NOT BSCSMAMJ (Computer Science Math) Majors'),
(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'ENGL', 'English', '11A', '11', 'A', 74424, 'Cultures and Ideas I', 'MW', 17, '05:25 PM', '07:10 PM', 'OCONR 209', '', '', '', '', 'Tremblay-McGaw,Robin J', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 1, 'Literatures of the World', 'Literatures of the World - Literatures of the World introduces you to the study and history of global cultural interaction. We will engage this history through reading literatures from around the world over a 300 year period, exploring the ideas, texts, and writers who have been shaped by and who have shaped the modern world. All nations have rich literary traditions, and part of our work will be to understand both similarities and differences across cultures. We will see the roots of our present in our readings: global contact, conflicts, explorations, colonization, intellectual trends, social change\Zand we will examine the emergence of new literary forms often influenced by texts from other cultures.  Offered Fall 2018 and Winter 2019', '', '', ''),
