(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'CLAS', 'Classics', '11A', '11', 'A', 74727, 'Cultures and Ideas I', 'MWF', 9, '09:15 AM', '10:20 AM', 'KENNA 214', '', '', '', '', 'Crofton-Sleigh,Elizabeth Jane', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 2, 'Sports & Spectacle', 'Sports & Spectacle:  This two-quarter C&I course examines how ancient Greeks, Romans, and other cultures conceived of sports and other athletic events, as well as the people involved. We will use these ancient perspectives on sports as a lens through which we can better understand contemporary practices and attitudes regarding sports and athletes, and the connections between past and present. Topics to be considered include gender and ethnicity, cheating/unfair advantages, economics, religion, the context of sports, and the nature of the audience. We will also explore sociological, moral, and ethical issues in sports, as well as its relationship to the community.  Offered Fall 2018 and Winter 2019.', '', '', ''),
