(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'CLAS', 'Classics', '11A', '11', 'A', 74726, 'Cultures and Ideas I', 'MW', 17, '05:25 PM', '07:10 PM', 'OCONR 103', '', '', '', '', 'Holzmeister,Angela Elizabeth', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 1, 'Friendship: Ancient and Modern', 'Friendship: Ancient & Modern - This two-sequence course examines both literary representations and philosophies of friendship offered in a variety of texts written by ancient authors from around the Mediterranean basin, including authors from the ancient Greek, Roman, Egyptian, and Near Eastern cultures.  This course, furthermore, explores the far-reaching influence these texts have had on our modern understanding of friendship, and asks if the ancient models of friendship will continue to be viable in the age of social media.  Offered Fall 2018 and Winter 2019.', '', '', ''),
