(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'ENVS', 'Environ Studies & Sciences', '1A', '1', 'A', 74766, 'Critical Thinking & Writing I', 'TR', 10, '10:20 AM', '12:00 PM', 'ALAM 101', '', '', '', '', 'Grudin,Theodore Robert', '', '', 0, '4.00', '4.00', 'D', 0, 'E', 1, '', '', 'UC32', 'Composition', ''),
(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'ENVS', 'Environ Studies & Sciences', '11A', '11', 'A', 74767, 'Cultures and Ideas I', 'TR', 12, '12:10 PM', '01:50 PM', 'WALSH MULP', '', '', '', '', 'Grudin,Theodore Robert', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 1, 'Nature & Imagination', 'Nature & the Imagination examines cross-cultural perspectives on nature through eight themes \'nature as monster, inspiration, quest, wildness, victim, commodity, paradise, and dystopia\' exploring each theme from a variety of historical and cultural contexts.  Our two-course sequence employs a multi-textual approach, comparing (sometimes conflicting) ideas about nature expressed in myth, art, literature, music, drama, story, philosophy and sacred text.  The assignments and class activities we will undertake will promote eco-critical reflection on the relevance of the past to human imagining about nature in the present.  We hope you will develop an appreciation that how we conceptualize nature not only influences how we understand ourselves, but how we develop concern for the environment.  Offered Fall 2018 and Winter 2019.', '', '', ''),
