(4000, 'Fall 2018', 'UNV', 'University Programs', 'UGRD', 'Undergraduate', 'HNRS', 'Honors Program', '20', '20', '', 74847, 'Difficult Dialogues', 'TR', 10, '10:20 AM', '12:00 PM', 'DOWD 122', '', '', '', '', 'Lukes,Timothy J', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 1, 'Wilderness:History of an Idea', '', '', '', 'Course restricted to Honors Program Students'),
(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'HIST', 'History', '11A', '11', 'A', 74849, 'Cultures and Ideas I', 'TR', 10, '10:20 AM', '12:00 PM', 'OCONR 207', '', '', '', '', 'Randall,Amy E', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 1, 'Identity & the Other', 'Identity & the Other - A two-course sequence: The practice of making the Other to define the self is hardly a modern phenomenon.  Yet this practice has had particular ramifications during the last three centuries.  This course will examine the centrality of the construction of the Other in an era of democratic and socialist revolutions, industrialization, nation-state formation, total war, genocide, decolonization, migration and globalization.  Its focus will be primarily on Western and Eastern Europe, the Middle East, Africa, and their interconnections, from 1700 to the present.  Offered Fall 2018 and Winter 2019.', '', '', ''),
(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'HIST', 'History', '11A', '11', 'A', 74850, 'Cultures and Ideas I', 'TR', 15, '03:50 PM', '05:30 PM', 'OCONR 201', '', '', '', '', 'Skinner,David', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 2, 'Cultures of Islam', 'Cultures of Islam - A two-course sequence: The first course in this sequence examines the origins and development of Islamic ideas and culture to 1400 and the rise and fall of the early Islamic empires. The second course in the sequence on Islam analyzes the continuity of Islamic ideas and culture in face of the development of multiple Islamic societies and the domination of European empires after the 18th century.  Offered Fall 2018 and Winter 2019', '', '', ''),
(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'HIST', 'History', '11A', '11', 'A', 74851, 'Cultures and Ideas I', 'MWF', 13, '01:00 PM', '02:05 PM', 'OCONR 201', '', '', '', '', 'Turley,Thomas P', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 2, 'Civilization & the City', 'Civilization & the City - This two-course sequence examines the impact of the city on human life from the founding of the earliest large human settlements to the present. The first course analyzes the changes and challenges that civilized life brought to societies around the globe up through 1700, including shifts in art, culture, politics, social structures, religions, economies, gender relations, and physical and biological environments. The second course explores the growing complexity of civilization, human interactions, and the city space in the last three centuries, the global urban landscape that is currently emerging, and the difficulties of re-imagining humanity\Zs relationship to the urban space in the future.  Offered Fall 2018 and Winter 2019', '', '', ''),
(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'HIST', 'History', '11A', '11', 'A', 74852, 'Cultures and Ideas I', 'TR', 8, '08:30 AM', '10:10 AM', 'OCONR 106', '', '', '', '', 'Tamayo,David', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 1, 'Borderlands in the Americas', 'Borderlands of empires and nations throughout history have been regions of conflict but also of contact. They are areas where people, goods, and ideas traveled back and forth. Since the conquest of the Americas, Indians, Europeans, Africans, and Asians have fought, traded, lived, and created new cultural identities on the continent\'s borderlands. This two-sequence course focuses on the borderlands in the Americas from the colonial era (first quarter) to the national period (second quarter). The second term will pay special attention to the US-Mexico border, the history of immigration, and the violence surrounding the drug trade.   Offered Fall 2018 and Winter 2019.', '', '', ''),
(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'HIST', 'History', '11H', '11', 'H', 74853, 'Cultures and Ideas I - Honors', 'TR', 8, '08:30 AM', '10:10 AM', 'OCONR 210', '', '', '', '', 'Molony,Barbara A', '', '', 0, '4.00', '4.00', 'D', 0, 'E', 1, 'Across the Pacific', 'Across the Pacific - Interactions in the Pacific Ocean world - imperialism and war in the nineteenth and twentieth centuries and economic dominance (China), global influence in fashion and the arts (Japan and Korea), and global transmission of disease and natural disasters (Southeast Asia) in the twenty-first century - often come to mind when contemporary Americans are asked about East Asia. And yet, the global linkages of East Asia to the Americas and Europe are hardly the product of modernity alone. Migrations, trade, ideas, religions, and the products of biology (foods and diseases) have linked the Pacific Ocean world for millennia.  Offered Winter 2018 and Fall 2019.', '', '', 'Course restricted to Honors Program Students'),
(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'HIST', 'History', '92', '92', '', 74854, 'Modern East Asia', 'TR', 14, '02:00 PM', '03:40 PM', 'OCONR 109', '', '', '', '', 'Molony,Barbara A', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 1, '', '', 'UC01', 'Area Studies/Regional Core requirement', ''),
(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'HIST', 'History', '11A', '11', 'A', 74855, 'Cultures and Ideas I', 'TR', 12, '12:10 PM', '01:50 PM', 'OCONR 102', '', '', '', '', 'Brillman,Michael Louis', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 2, 'Slavery & Unfreedom', 'Slavery & Unfreedom - This two-course sequence traces the history of slavery and unfree labor in world history.  Particular emphasis will be on comparison of the Atlantic World and Indian Ocean contexts.  Offered Fall 2018 and Winter 2019.', '', '', ''),
