(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'PHIL', 'Philosophy', '15', '15', '', 75120, 'Hist of West Phil:Early Modern', 'TR', 15, '03:50 PM', '05:30 PM', 'KENNA 105', '', '', '', '', 'Cronin,Madeline Ann', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 1, '', 'History of Western Philosophy:  Early Modern\nWith Philosophy 14 and 16, satisfies Western Culture sequence requirement for the bachelor\Zs degree in all undergraduate colleges.', 'UC30', 'Western Culture', ''),
(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'PHIL', 'Philosophy', '11A', '11', 'A', 75121, 'Cultures and Ideas I', 'MWF', 9, '09:15 AM', '10:20 AM', 'KENNA 218', '', '', '', '', 'Frise,Matthew Justin', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 2, 'Philosophy, Society, & Culture', 'Philosophy, Society & Culture - A two-course examination of major political theories in the history of Western philosophy. The course addresses ethical theory and social theory. It focuses on culture and the interactions among cultures, addressing Jewish and Arabic culture as well as the conquest of America, colonial Africa and colonial India.  Offered Fall 2018 and Winter 2019.', '', '', ''),
(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'PHIL', 'Philosophy', '11A', '11', 'A', 75122, 'Cultures and Ideas I', 'MWF', 10, '10:30 AM', '11:35 AM', 'KENNA 109', '', '', '', '', 'Kain,Philip J', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 2, 'Philosophy, Society, & Culture', 'Philosophy, Society & Culture - A two-course examination of major political theories in the history of Western philosophy. The course addresses ethical theory and social theory. It focuses on culture and the interactions among cultures, addressing Jewish and Arabic culture as well as the conquest of America, colonial Africa and colonial India.  Offered Fall 2018 and Winter 2019.', '', '', ''),
(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'PHIL', 'Philosophy', '11A', '11', 'A', 75123, 'Cultures and Ideas I', 'MWF', 14, '02:15 PM', '03:20 PM', 'KENNA 104', '', '', '', '', 'Kain,Philip J', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 2, 'Philosophy, Society, & Culture', 'Philosophy, Society & Culture - A two-course examination of major political theories in the history of Western philosophy. The course addresses ethical theory and social theory. It focuses on culture and the interactions among cultures, addressing Jewish and Arabic culture as well as the conquest of America, colonial Africa and colonial India.  Offered Fall 2018 and Winter 2019.', '', '', ''),
(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'PHIL', 'Philosophy', '11A', '11', 'A', 75124, 'Cultures and Ideas I', 'TR', 8, '08:30 AM', '10:10 AM', 'KENNA 214', '', '', '', '', 'Ramirez,Erick Jose', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 1, 'World History of Emotion', 'World History of Emotion - In this two-quarter sequence we will conduct a cross-cultural analysis of emotions. Emotions puzzle and fascinate philosophers, psychologists, and neuro-scientists alike. We will investigate how different cultures have understood emotions and concentrate on exploring the ways in which different contemporary and historical cultures understand the relationship between emotion and moral value. In the first quarter we will study shame, guilt, happiness, and fear. In the second quarter we will analyze cross-cultural understandings of love, disgust, and anger/retribution. Students will gain an appreciation of the ways different societies have understood what emotions are and how emotions enforce and create moral norms.  Offered Fall 2018 and Winter 2019.', '', '', '');
