(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'MUSC', 'Music', '11A', '11', 'A', 75294, 'Cultures and Ideas I', 'TR', 14, '02:00 PM', '03:40 PM', 'MDF 103', '', '', '', '', 'Paulraj,Kavin Dayanandan', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 1, 'Global Music/Cultural Politics', 'Global Music/Cultural Politics - A two-course sequence approaching world cultures and civilizations with an emphasis on music and the specific musical instruments used in the practice of that music. This course is designed to examine the historical and social environments in which people have expressed themselves artistically and what has motivated them to create art in general and make music in particular.  An examination of early cultures around the world is used to inform us of the intellectual, political, religious, social, emotional and aesthetic aspects of civilization as a whole. The second quarter approaches world cultures and civilizations with an emphasis on music and the specific musical instruments used in the practice of music from the 15th century to current times. We will compare the historical and social environments in which people have expressed themselves artistically and what has motivated them to create art and music.  Offered Fall 2018 and Winter 2019.', '', '', ''),
