(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'WGST', 'Women\'s and Gender Studies', '11A', '11', 'A', 75305, 'Cultures and Ideas I', 'MW', 17, '05:25 PM', '07:10 PM', 'VARSI 114', '', '', '', '', 'Sharangpani,Mukta H', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 1, 'Women in Transn\'l Perspective', 'Women in Transnational Perspective - In this two course sequence we examine women\'s lives across various racial, ethnic and cultural borders.  In the first quarter we develop a transnational feminist framework for examining women\'s lives across diverse contexts which challenges dominant assumptions about the claimed \'universality\' of women\'s experiences.  In the second quarter we look more closely at women\'s activism and social movements, drawing on both historical and contemporary examples of advocacy at national and transnational levels. Course readings are drawn from a wide range of disciplines, each offering unique insights into topics such as: the social construction of gender, race and representation, bodies and beauty, gender and the global economy, gender, sexuality and the nation, tourism, suffrage, reproductive rights, environmental justice and militarized sexual violence.  Offered Fall 2018 and Winter 2019.', '', '', ''),
