(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'ANTH', 'Anthropology', '11A', '11', 'A', 75389, 'Cultures and Ideas I', 'TR', 10, '10:20 AM', '12:00 PM', 'OCONR 103', '', '', '', '', 'Nelson,Robin G.', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 2, 'Measuring Humanity', 'Measuring Humanity - In this two-quarter course, we will examine how cultures, past and present, seek to understand (and control) the variation they see in the world around them. The specific goals of this course are: 1) to place development of key institutions or categories within a cultural context to understand the history of key concepts in cultural variation; 2) to critically analyze how anthropological data have been interpreted and misinterpreted, and; 3) to analyze cross culturally and historically culture, war, sport, race/ethnicity, civilization, and language.  Offered Fall 2018 and Winter 2019.', '', '', ''),
(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'ARTH', 'Art History', '11A', '11', 'A', 75390, 'Cultures and Ideas I', 'MWF', 13, '01:00 PM', '02:05 PM', 'DOWD 210', '', '', '', '', 'Maxwell,Kathleen E', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 1, 'Art, Power, & Propaganda', 'Art, Power, & Propaganda: This two-quarter course addresses two artistic styles usually considered antithetical: classical art of ancient Greece developed in the 5th century B.C.E. and Islamic art which first appears over 1000 years later in the 7th C.E. Classical art and culture serve as the foundation of what is known as the Western canon and Islamic art is often juxtaposed to it as one of a number of ""non-Western"" (i.e., Oriental) forms of artistic expression. Our first goal is to appreciate their differences and to recognize significant areas of cross-fertilization. We shall discover that classical culture played as important a role in the formation of Islamic culture as it did in Western culture. We will ask what did the classical style symbolize to those who resurrected it in so many neoclassical episodes throughout history? How often can neoclassicism be linked to political goals?  Offered Fall 2018 and Winter 2019.', '', '', ''),
(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'ARTH', 'Art History', '11A', '11', 'A', 75391, 'Cultures and Ideas I', 'TR', 8, '08:30 AM', '10:10 AM', 'DOWD 208', '', '', '', '', 'Sridharan,Shriya', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 1, 'Art of the Indian Subcontinent', 'Art of the Indian Subcontinent: This course is a survey of Indian art from ancient to contemporary time periods examined through four key frameworks that highlight the major cross-cultural encounters that have shaped its history. In Part 1, roughly covering the time period of 1 B.C.E to the eighteenth century, the frameworks will be: \'Buddhism & Hinduism\' and \'Islamic Monuments & Mughal Miniatures\'. In Part 2 we will engage with modern and contemporary Indian art & architectural practices from the nineteenth century to the present, through the lenses of \'Colonialism and Modernity\' & \'The Contemporary Global\'.  Offered Fall 2018 and Winter 2019.', '', '', ''),
