(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'ENGL', 'English', '106', '106', '', 75402, 'Advanced Writing', 'MWF', 13, '01:00 PM', '02:05 PM', 'OCONR 103', '', '', '', '', 'Tremblay-McGaw,Robin J', '', '', 0, '5.00', '5.00', 'N', 0, 'E', 1, 'The Rhetoric of Forms', 'We are surrounded by a variety of textual and visual forms that seem to keep proliferating, from cave paintings to tweets, Instagram, and Facebook; film and video are available to us on our phones, on the big screen and our computer screens; we can read a novel or a book of poems or listen to them online; anime and graphic novels and films proliferate. Mural art and graffiti pepper urban buildings and appear alongside other works in museums and galleries. In this class, we will consider the role of form in a variety of works; in turn, the assignments will offer you an opportunity to experiment with forms that interest you.', 'UC24', 'Third Writing', ''),
