(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'ENGL', 'English', '139', '139', '', 75484, 'Topics in American Literature', 'TR', 12, '12:10 PM', '01:50 PM', 'STJOS 309', '', '', '', '', 'Beers,Terry L', '', '', 0, '5.00', '5.00', 'N', 0, 'E', 1, 'Nature v Culture: Mod Writing', '. . . to lead back to splendor\Z: Nature and Culture in Modern American Poetry and Fiction\n\nThis version of Topics in American Literature (English 139) explores how modern American poets and fiction writers\Zfaced with a rapidly shifting cultural landscape marked by artistic innovations, rising religious skepticism, failures of political leadership, seemingly unbounded scientific and technological developments, grueling economic hardships, and the lamentable and increasing separation of humanity from the natural world\Zembraced and challenged the uncertainties of the era, aiming \Zto lead back to splendor,\Z in Ezra Pound\Zs memorable phrase.', 'UC26', 'U.S.', ''),
