(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'ITAL', 'Italian Studies', '11A', '11', 'A', 75519, 'Cultures and Ideas I', 'TR', 10, '10:20 AM', '12:00 PM', 'CASA 8', '', '', '', '', 'Bubula-Phillips,Irene', '', '', 0, '4.00', '4.00', 'N', 0, 'E', 1, 'Italy, Gateway of Cultures', 'Italy, Gateway of Cultures - This two-quarter course sequence explores Italian culture from ancient Rome through the Middle Ages and Renaissance to Italy today, emphasizing Italian interactions with other cultures in the Mediterranean, northern Europe, and the United States. Students wanting to hone their critical thinking, reading, and writing skills as well as their public speaking and presentation skills will have the opportunity to do so through class discussions, guest lectures, and ongoing analysis of literature, art, films, and music by and about Italians.  We might read ancient Roman history, listen to an opera, interpret Renaissance art, handle 500-year-old books, watch The Sopranos, and blog about immigration policies, always keeping an eye out for syncretism and asking what happens when different cultures meet in an Italian context.  Students will also have the opportunity to do two major projects such as cooking a medieval feast and re-engineering a Leonardo da Vinci invention.  Offered Fall 2018 and Winter 2019.', '', '', ''),
