(4000, 'Fall 2018', 'AS', 'College of Arts and Sciences', 'UGRD', 'Undergraduate', 'PHIL', 'Philosophy', '11H', '11', 'H', 75528, 'Cultures and Ideas I - Honors', 'MWF', 8, '08:00 AM', '09:05 AM', 'KENNA 109', '', '', '', '', 'Yang,Eric Timothy', '', '', 0, '4.00', '4.00', 'D', 0, 'E', 1, 'Death, Afterlife, and Meaning', 'Death, Afterlife, & Meaning - This two course sequence will investigate topics concerning death, immortality, and the meaning of life, especially under different cultural perspectives, including the religious, social, and historical influences that led to the generation and development of these ideas. Our goal is to delve deeper into these issues while bolstering various intellectual skills. We will examine both historical and contemporary readings while exploring ideas pertaining to these themes that have their roots in both western and eastern cultures. Topics include the nature and value of death, whether life is meaningful and what can make it be so, and various conceptions of life after death.  Offered Fall 2018 and Winter 2019.', '', '', 'Course restricted to Honors Program Students'),
